import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // Importa Link desde react-router-dom

const Sidebar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const toggleSidebar = () => {
    setIsOpen(!isOpen);
  };

  return (
    <div className={`sidebar ${isOpen ? 'open' : 'closed'}`}>
      <div className="sidebar-header">
        <img className="menu-icon" src="/img/menu.svg" alt="Menu Icon" onClick={toggleSidebar} />
      </div>
      <div className="sidebar-content">
        <a className="centrar-logo" href="/">
          <img className="logo" src="/img/logo-iciamex.png" alt="ICIAMEX logo" />
        </a>
        <nav id="primary-menu" className="navbar">
          <ul className="nav navbar-nav">
            {/* Usa Link en lugar de <a> para las rutas */}
            <li><Link to="/ordenes-de-compra"><span className="icon">📝</span><span className="text">Ordenes de Compra</span></Link></li>
            <li><Link to="/cotizaciones"><span className="icon">📊</span><span className="text">Cotizaciones</span></Link></li>
            <li><Link to="/facturas"><span className="icon">📜</span><span className="text">Facturas</span></Link></li>
            <li><Link to="/lista-de-proveedores"><span className="icon">🛒</span><span className="text">Lista de Proveedores</span></Link></li>
            <li><Link to="/lista-de-clientes"><span className="icon">👥</span><span className="text">Lista de Clientes</span></Link></li>
            <li><Link to="/ListadeArticulos"><span className="icon">📦</span><span className="text">Lista de Artículos</span></Link></li>
            <li><Link to="/informes"><span className="icon">📈</span><span className="text">Informes</span></Link></li>
          </ul>
        </nav>
      </div>
      <div className="sidebar-footer">
        <div className="sidebar-copyright">&copy; 2024 ICIAMEX</div>
      </div>
    </div>
  );
};

export default Sidebar;
